                  "type":"string",
                  "value":"\n\"Does it matter all that much?\" I squarely dismissed her baseless deduction, \"People choose who they want to interact with all the time, you can't expect to get along with everyone.\" I had put it quite bluntly, but it was a straight honest opinion. \"Besides, if they don't wanna talk to such a sweet girl like you its their loss; at the very least you have Alice and I.\" Claire giggled at my added statement, somehow finding joy from my half-baked attempt at consoling her. Well, she seemed to have cheered up at the very least"
